import React, { useState } from "react";
import ReactMarkdown from "react-markdown";

const RequestPostPage: React.FC = () => {
  return (
    <React.Fragment>
      <h1 className="post-form-heading">Ask a Question</h1>
      <form className="post-form-container">
        <input
          type="text"
          className="post-form-input"
          id="title"
          placeholder="Title"
          required
        />
        <textarea id="body" cols={30} rows={10} placeholder="Body" required />
      </form>
    </React.Fragment>
  );
};

export default RequestPostPage;
